import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Landingpage from './Landingpage/landingpage';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<Landingpage />} />

        </Routes>
      </Router>
    </div>
  );
}

export default App;
